// SPDX-License-Identifier: MIT
pragma solidity >=0.4.0 < 0.9.0;
// 버전 명시

// 컨트렉트의 이름을 지정 
contract user_info{
    // 유저의 정보를 저장 컨트렉트 

    // 유저의 정보를 저장하는 구조를 하나 생성
    // mysql table 설정과 흡사
    struct info{
        // 유저의 정보가 존재하는지 확인하는 변수
        uint8 state;
        string id;
        string password;
        string name;
        string phone;
    }

    // mapping 데이터 생성
    // mapping이 무엇인가? 
    // json 형태와 흡사 -> key : value
    // 유저의 ID 값을 기준으로 하여 info라는 구조체를 하나씩 대입
    // ex) {
        //      ID : {
        //          state : xxxx, 
        //          id : xxxxx,
        //          password : xxxxx,
        //          name : xxxx,
        //          phone : xxxxxx
        //      },        
        //      ID2 : {
        //          state : xxxx, 
        //          id : xxxxx,
        //          password : xxxxx,
        //          name : xxxx,
        //          phone : xxxxxx
        //      },
        // } 
    mapping (string => info) internal users;

    // 유저의 정보를 등록하는 함수 
    function add_user(
        string memory _id, 
        string memory _pass, 
        string memory _name, 
        string memory _phone
    ) public {
        // 회원 정보가 존재한다면 함수의 호출을 거절
        // state가 0이면 회원 정보가 존재하지 않는다. 
        // state가 0이 아니면 회원 정보가 존재.
        require(users[_id].state == 0, 'Exist ID');
        // mapping 데이터에 _id 값을 키 값으로 value 대입
        users[_id].id = _id;
        users[_id].password = _pass;
        users[_id].name = _name;
        users[_id].phone = _phone;
        users[_id].state = 1;
    }

    // 유저의 정보를 출력하는 함수 생성 
    function view_info(
        string memory _id
    ) public view returns(
        string memory, 
        string memory, 
        string memory, 
        string memory
    ){
        string memory id = users[_id].id;
        string memory pass = users[_id].password;
        string memory name = users[_id].name;
        string memory phone = users[_id].phone;

        return (id, pass, name, phone);
    }



}
